from typing import List
import copy

class Solution:
    def numIslands(self, grid: List[List[str]]) -> int:
        if not grid:
            return 0
        res = 0
        row = len(grid)
        column = len(grid[0])
        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if grid[i][j] == '0':
                    continue
                next = [[i, j]]
                while next:
                    for p in next:
                        grid[p[0]][p[1]] = '0'
                        if self.valid_point(row, column, [p[0] - 1, p[1]]) and grid[p[0] -1][p[1]] == '1':
                            grid[p[0] -1][p[1]] = '0'
                            next.append([p[0] - 1, p[1]])
                        if self.valid_point(row, column, [p[0] + 1, p[1]]) and grid[p[0] + 1][p[1]] == '1':
                            grid[p[0] + 1][p[1]] = '0'
                            next.append([p[0] + 1, p[1]])
                        if self.valid_point(row, column, [p[0], p[1] - 1]) and grid[p[0]][p[1] - 1] == '1':
                            grid[p[0]][p[1] - 1] = '0'
                            next.append([p[0], p[1] - 1])
                        if self.valid_point(row, column, [p[0], p[1] + 1]) and grid[p[0]][p[1] + 1] == '1':
                            grid[p[0]][p[1] + 1] = '0'
                            next.append([p[0], p[1] + 1])
                        next.remove(p)
                res += 1
        return res

    def valid_point(self, row, column, point):
        return point[0] >= 0 and point[0] < row and point[1] >=0 and point[1]< column
